// src/pages/Login.js
import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import toast from "react-hot-toast";
import logo from "../../assets/sweetbite-logo.png"; // Use your logo path

export default function Login() {
  const { login } = useAuth();
  const navigate = useNavigate();

  const [form, setForm] = useState({ email: "", password: "" });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    setForm((s) => ({ ...s, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    setLoading(true);

    try {
      // login() returns the user object with role
      const loggedInUser = await login(form.email, form.password);

      toast.success(`Welcome back, ${loggedInUser.name}! üéâ`);

      // ‚≠ê ROLE-BASED REDIRECT ‚≠ê
      if (loggedInUser.role === "admin") {
        navigate("/admin/dashboard");
      } else {
        navigate("/");
      }
    } catch (err) {
      console.error("Login failed:", err);

      let message = "Invalid credentials. Please try again.";

      if (err?.response?.data?.message) {
        message = err.response.data.message;
      } else if (err?.response?.data?.errors) {
        const errors = err.response.data.errors;
        if (errors && typeof errors === "object") {
          const errorMessages = Object.values(errors).flat();
          message = errorMessages.join(", ");
        }
      }

      setError(message);
      toast.error("Login failed ‚ùå");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      className="min-h-screen flex items-center justify-center bg-cover bg-center"
      style={{
        backgroundImage:
          "url('/assets/cakes-bg.jpg'), linear-gradient(rgba(0,0,0,0.6), rgba(0,0,0,0.6))",
        backgroundBlendMode: "darken",
      }}
    >
      <div className="bg-black bg-opacity-70 rounded-xl shadow-2xl p-8 w-full max-w-md flex flex-col items-center">
        <img src={logo} alt="Sweet Bite Logo" className="w-16 h-16 mb-2" />
        <h1 className="text-4xl font-bold text-[#e7bfa7] mb-2 font-cursive tracking-wide">
          Sweet Bite
        </h1>
        {error && (
          <p className="text-red-400 text-sm mb-3 text-center">{error}</p>
        )}

        <form onSubmit={handleSubmit} className="w-full space-y-5 mt-2">
          <div className="relative">
            <span className="absolute left-3 top-1/2 -translate-y-1/2 text-gray-400 text-xl">
              <i className="fas fa-user"></i>
            </span>
            <input
              type="email"
              name="email"
              value={form.email}
              onChange={handleChange}
              required
              autoFocus
              placeholder="Username or email address"
              className="w-full pl-10 pr-3 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
            />
          </div>
          <div className="relative">
            <span className="absolute left-3 top-1/2 -translate-y-1/2 text-gray-400 text-xl">
              <i className="fas fa-lock"></i>
            </span>
            <input
              type="password"
              name="password"
              value={form.password}
              onChange={handleChange}
              required
              placeholder="Password"
              className="w-full pl-10 pr-3 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
            />
          </div>
          <div className="flex justify-end">
            <Link
              to="/forgot-password"
              className="text-[#e7bfa7] text-sm hover:underline"
            >
              Forgot Password?
            </Link>
          </div>
          <button
            type="submit"
            disabled={loading}
            className="w-full bg-[#7b3f00] hover:bg-[#a05a2c] text-white font-bold py-3 rounded-lg text-lg transition disabled:opacity-60"
          >
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>
      </div>
    </div>
  );
}
